import './App.css';
import logo_text from './img/logo_text2.png';
import hamburger from './img/hamburger_icon.png';
import menu_icon from '.img/menu.png';

function App() {
	return (
		<div className="App">
			<div className='navbar'>
				<img src={logo_text} className='logo_text' alt='personality_behaviors'></img>
				<img src={hamburger} className='hamburger' alt='hamburger_icon'></img>
			</div>
		</div>
	);
}

export default App;
